import 'dart:math';
double julian(int year, int month, int day) {
  int iy = year; int m = month; int d = day;
  if(m < 3) {
    iy -= 1;
    m += 12;
  }
  int ia = (iy/100.0).floor();
  int ib = 2 - ia + (ia/4.0).floor();
  if(iy < 0) {ib = 0;}
  double jd = (365.25*(iy + 4716)).toInt() + (30.6001*(m + 1)).toInt() + d + ib - 1524.5;
  return jd;
}
